import React from 'react'
import './MainLogin.css';

function MainLogin () {
  return (
    <div className="mainLogin">
      <div className='names'>
        <h2>UserName</h2>
        <h2>Password</h2>
      </div>

      <div className='inputs'>
        <input placeholder="Ex: toto"  type="text" ></input>
        <input placeholder="Ex: toto"  type="password" ></input>
      </div>
        
    </div>
  )
}

export default MainLogin;
